FOREIGN KEY (`id_cau`) REFERENCES `causes` (`id_cau`) ON DELETE CASCADE ON UPDATE CASCADE,
INDEX `det_pro_fk` (`det_pro`) USING BTREE ,
INDEX `id_rec_fk2` (`id_rec`) USING BTREE ,
INDEX `detreceta_ibfk_3` (`id_cau`) USING BTREE 
