	`cb`.`F_Cb` AS `cb`,
	`p`.`des_pro` AS `des_pro`,
	`dp`.`lot_pro` AS `lot_pro`,
	`dp`.`cad_pro` AS `cad_pro`,
	`dp`.`id_ori` AS `id_ori`,
	`i`.`cant` AS `cant`,
	`p`.`f_status` AS `f_status`,
	`i`.`cla_uni` AS `cla_uni`,
	`p`.`cos_pro` AS `cos_pro`,
	dp.det_pro, i.id_inv
FROM
	(
		(
			(
				`productos` `p`
				JOIN `detalle_productos` `dp`
			)
			JOIN `inventario` `i`
		)
		JOIN `tb_codigob` `cb`
	)
WHERE
	(
		(
			`p`.`cla_pro` = `dp`.`cla_pro`
		)
		AND (
			`dp`.`det_pro` = `i`.`det_pro`
		)
		AND (
			`dp`.`cla_pro` = `cb`.`F_Clave`
		)
		AND (
			`dp`.`lot_pro` = `cb`.`F_Lote`
		)
		AND (
			`dp`.`cad_pro` = `cb`.`F_Cadu`
		)
	) ;

