.`id_usu`) and (`r`.`id_pac` = `pac`.`id_pac`) and (`r`.`cedula` = `m`.`cedula`) and (`r`.`id_ser` = `ser`.`id_ser`) and (`r`.`id_rec` = `dr`.`id_rec`) and (`dr`.`id_cau` = `c`.`id_cau`) and (`dr`.`det_pro` = `dp`.`det_pro`) and (`dp`.`id_ori` = `o`.`id_ori`) and (`dp`.`cla_pro` = `p`.`cla_pro`))) ;

