CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `recetas` AS (select `dr`.`fol_det` AS `fol_det`,`r`.`fol_rec` AS `fol_rec`,`p`.`nom_com` AS `nom_com`,`r`.`fecha_hora` AS `fecha_hora`,`pr`.`cla_pro` AS `cla_pro`,`pr`.`des_pro` AS `des_pro`,`dr`.`can_sol` AS `can_sol`,`dr`.`cant_sur` AS `cant_sur`,`r`.`transito` AS `transito`,`r`.`id_rec` AS `id_rec`,`r`.`baja` AS `baja`,`dr`.`indicaciones` AS `indicaciones`,`m`.`nom_com` AS `medico`,`dp`.`lot_pro` AS `lote`,`dp`.`cad_pro` AS `caducidad`,`dr`.`id_cau` AS `cause`,`m`.`cedula` AS `cedula`,`m`.`rfc` AS `rfc`,`p`.`expediente` AS `expe`,`p`.`num_afi` AS `afi`,`p`.`sexo` AS `sexo`,`p`.`tip_cob` AS `tip_cob`,(year(curdate()) - year(`p`.`fec_nac`)) AS `fechan`,`u`.`des_uni` AS `uni`,`u`.`claisem` AS `isem`,`u`.`clajur` AS `juris`,`u`.`cla_uni` AS `cla_uni`,`u`.`domic` AS `domic`,`r`.`id_tip` AS `id_tip`,`dp`.`det_pro` AS `det_pro`,`dr`.`fec_sur` AS `fec_sur`,`dp`.`id_ori` AS `id_ori`,concat(`pr`.`cla_pro`,' - ',`pr`.`des_pro`) AS `clavepro`,concat('LOTE: ',`dp`.`lot_pro`,' - CADUCIDAD: ',`dp`.`cad_pro`) AS `lotepro`,`ser`.`nom_ser` AS `nom_ser`,`usu`.`nombre` AS `nombre` from ((((((((`receta` `r` join `pacientes` `p`) join `detreceta` `dr`) join `detalle_productos` `dp`) join `productos` `pr`) join `medicos` `m`) join `unidades` `u`) join `servicios` `ser`) join `usuarios` `usu`) where ((`p`.`id_pac` = `r`.`id_pac`) and (`r`.`id_rec` = `dr`.`id_rec`) and (`dr`.`det_pro` = `dp`.`det_pro`) and (`dp`.`cla_pro` = `pr`.`cla_pro`) and (`r`.`cedula` = `m`.`cedula`) and (`r`.`id_usu` = `usu`.`id_usu`) and (`r`.`id_ser` = `ser`.`id_ser`) and (`r`.`id_usu` = `usu`.`id_usu`) and (`usu`.`cla_uni` = `u`.`cla_uni`))) ;

