CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `salidas` AS SELECT
		`dr`.`fol_det` AS `fol_det`,
		`e`.`det_pro` AS `det_pro`,
		`dr`.`can_sol` AS `can_sol`,
		`dr`.`cant_sur` AS `cant_sur`,
